package friendly;

public class DoWhile {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		double d = 39;
		
		while (d<50)
		{
			System.out.println("d=" +d);
			d++;
		}
		
		System.out.println(">>>>>><<<<<<");
		
		
		d = 23.5;
		
		do 
		{
					System.out.println("d=" +d);
				d++;
	}
	 while (d<25);
	}

}
